import React from 'react'
import PaypalExpressBtn from 'react-paypal-checkout'
 
export default class PaypalButton extends React.Component {
    render() {
        const onSuccess = (payment) => {
            		console.log("The payment was succeeded!", payment);
                    
            		this.props.tranSuccess(payment);
        }
 
        const onCancel = (data) => {
            console.log('The payment was cancelled!', data);
        }
 
        const onError = (err) => {
            console.log("Error!", err);
        }
 
        let env = 'sandbox';
        let currency = 'USD'; 
        let total = 1;
 
        const client = {
            sandbox:    'AfaebvtFXBG3t5j-v689WokLyo9nPyiB-_GtZG9YASPNrBEP2YeUnMJTtg7cqciebv4wKh6fVuPso3ar',
            production: 'YOUR-PRODUCTION-APP-ID',
        }

        let style = {
            size: 'small',
            color: 'blue',
            shape: 'rect',
            label: 'checkout',
            tagline: false
        }
        return (
             <PaypalExpressBtn env={env} client={client} currency={currency} total={total} onError={onError} onSuccess={onSuccess} onCancel={onCancel} style={style}/>
        );
    }
}
